configdata.Program:
CREATE PROCEDURE setoutputs @IPAddress VARCHAR OUTPUT @Timesent DATETIME OUTPUT @_Timestamp DATETIME
@TestSubscriptionEntity VARCHAR @_SubscriptionEntity INTEGER OUTPUT @_accountID INTEGER @ParentAccountID INTEGER
AS

SET @IPAddress = '192.168.1.152';
SET @Timesent = @_Timestamp;

IF @TestSubscriptionEntity = 'N' or @TestSubscriptionEntity is null
	SET @_SubscriptionEntity = @_accountID
ELSE
	SET @_SubscriptionEntity = @ParentAccountID
